import React from "react";
import styled from "styled-components";
const Wrapper = styled.textarea`
  width: 100%;
  height: 154px;
  border-radius: 10px;
  border: solid 1px #dbdbdb;
  margin-top: 9px;
  padding: 18 23px;
  box-sizing: border-box;
`;
function TextArea() {
  return <Wrapper></Wrapper>;
}

export default TextArea;
